import classNames from 'classnames';

const FormInline = {
  props: {
    tag: {
      type: String,
      default: "form"
    },
    classes: {
      type: String
    }
  },
  computed: {
    className() {
      return classNames(
        'form-inline',
        this.classes
      );
    }
  }
};

export default FormInline;
export { FormInline as mdbFormInline };
